import React from "react";

const MemberTeams: React.FC = () => {
  // Mock data for demonstration purposes
  const members = [
    {
      name: "John Doe",
      team: [
        { golfer: "Golfer 1", points: 50 },
        { golfer: "Golfer 2", points: 30 },
        { golfer: "Golfer 3", points: 20 },
      ],
    },
    {
      name: "Jane Smith",
      team: [
        { golfer: "Golfer 4", points: 40 },
        { golfer: "Golfer 5", points: 25 },
        { golfer: "Golfer 6", points: 35 },
      ],
    },
  ];

  return (
    <div className="member-teams-page">
      <h1>Member Teams</h1>
      <div className="teams-list">
        {members.map((member, index) => (
          <div key={index} className="member-team">
            <h2>{member.name}</h2>
            <table className="team-table">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Points</th>
                </tr>
              </thead>
              <tbody>
                {member.team.map((player, idx) => (
                  <tr key={idx}>
                    <td>{player.golfer}</td>
                    <td>{player.points}</td>
                  </tr>
                ))}
              </tbody>
              <tfoot>
                <tr>
                  <td>Total Points</td>
                  <td>
                    {member.team.reduce(
                      (total, player) => total + player.points,
                      0
                    )}
                  </td>
                </tr>
              </tfoot>
            </table>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MemberTeams;
